import React from 'react';

const HeaderComponent = () => {
    return (
        <div>
            <header>
                <nav className="navbar navbar-expand-md navbar-dark bg-dark">
                    <a href="#" className="navbar-brand">Employee Management Application</a>
                </nav>
            </header>
        </div>
    );
};

export default HeaderComponent;
